import React,{ useState, useEffect } from 'react';
import './App.css';

function App() {
  const [memberdata,setdata] = useState([{}]);
  useEffect(()=>{
    fetch("/members").then(
      res=>res.json()
    ).then(
      data=>{
      setdata(data['arr']);
      console.log('data',data['arr']);
    }
  )
  },[])
  return (
    <div className="App">
    </div>
  );
}

export default App;
